description:
Print Craft Pro Fills 2 are the second volume in the Print Craft series. While slightly larger than Print Craft 1 these fills are also suited best for vehicle graphics, signs and banners. This title covers a wide spectrum of imaging including beautiful wood fills, flags, camo and much more. The hardware on the Print Craft 2 are supplied in .eps file format. This allows you to place the them over any image in a vector program without a visible background.

-18&quot; x 50&quot; 
  @ 72 dpi!

-Bonus hardware 
  included,

-423 images total,
